import './App.css';

function App() {
  return (
    <div className="App-header">
      <Formulario />
    </div>
  );
}

function Formulario(){
  return (
    <div className='form'>
        <label>
        Informe o percentual mínimo de concordância ( threshold ):
         <input name="myInput" defaultValue="0.9" />
        </label>
        <label>Informe os partidos a analisar:</label>
        <button>
          Gerar Grafos
        </button>

    </div>
  );
}

export default App;
